import React from "react";
import './style.css'
import Navbar from "./Nav-bar";

const App = () => {
  return (
    <>
      <div>
        <Navbar />
        <main>
          <div className="content">
            <h1>YOUR FEET
              DESERVE
              THE BEST</h1>
              <br/>

          </div>
          <div className="product-img"></div>
        </main>
      </div>
    </>
  );
}

export default App;
